full_text:
@MyBookieNBA This one's tough because it depends on your definition of "influential." 

Based on how the game is played? Steph Curry belongs. Based on gravitas/individual talent? Kobe Bryant belongs.

I think it's a little weird to have both. Kobe attempted to be an MJ clone...

@PierceWHuff There's at least one legitimate first-round QB bust per year. 

Say what you will about his surrounding cast in 2019, but he was a very average MWC QB.

Also, his physical talent &gt;&gt;&gt;&gt;&gt;&gt; his actual play. Usually those guys don't suddenly put it together

@NickColeSports Mac Jones benefits from the return of his starting LT, plus Jaylen Waddle, DeVonta Smith, John Metchie III and others.

He's shown he's capable of putting up numbers, and he'll be playing on a national title contender.

However, look out for Bryce Young long-term üëÄ

